import React from 'react';
import Navbar from './Navbar';

const Transaction = ({ selectedItems, checkoutCompleted }) => {
  // Static data to display in the table
  const staticData = [
    {
      id: 1,
      name: 'FP 10',
      description: 'This is a $10 FP voucher',
      points: 100,
      image: 'Fairprice10.jpg',
    },
    {
      id: 2,
      name: 'FP 20',
      description: 'This is a $20 FP Voucher',
      points: 200,
      image: 'Fairprice20.jpg',
    },
    {
      id: 3,
      name: 'FitBit Watch',
      description: 'This is a fitness tracking watch made by qwer company',
      points: 300,
      image: 'item3.jpg',
    },
  ];

  return (
    <div>
      <Navbar />
      <div className="divcss">
        <h2>Transaction page</h2>
        <h3>Checkout History</h3>
        {checkoutCompleted ? (
          <div className="transaction-details">
            <h4>Selected Items:</h4>
            <ul>
              {selectedItems.map((item) => (
                <li key={item.id}>
                  {item.name} - {item.points} Points
                </li>
              ))}
            </ul>
            <h4>Static Data Table:</h4>
            <table className="static-data-table">
              <thead>
                <tr>
                  <th>ID</th>
                  <th>Name</th>
                  <th>Description</th>
                  <th>Points</th>
                  <th>Image</th>
                </tr>
              </thead>
              <tbody>
                {staticData.map((item) => (
                  <tr key={item.id}>
                    <td>{item.id}</td>
                    <td>{item.name}</td>
                    <td>{item.description}</td>
                    <td>{item.points}</td>
                    <td>
                      {item.image && <img src={item.image} alt={item.name} />}
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        ) : (
          <p>No checkout history available.</p>
        )}
      </div>
    </div>
  );
};

export default Transaction;
